import React from 'react';
import '../styles/Login.css'; 

const Login = () => {
  return (
    <div className="login-page">
      <h1>Login/Sign Up</h1>
      <div className="login-form">
        <input type="text" placeholder="Email" />
        <input type="password" placeholder="Password" />
        <button>Login</button>
      </div>
    </div>
  );
};

export default Login;
